import { CloseOutlined, LoadingOutlined } from '@ant-design/icons'
import React from 'react'
import { btnBackgroundColor } from '../../uiConfig'

export default function Viewer(props) {
  return (
    <div style={{ display: '', border: `1px solid ${btnBackgroundColor}`, padding: '20px', margin: '20px', marginTop: '0px'}} align="left">
            <CloseOutlined style={{position: 'relative', right: '0px'}} />
            <div><span style={{paddingRight: '20px', paddingBottom: '5px', borderBottom: `2px solid ${btnBackgroundColor}`, fontSize: '17px'}}>{props.title}</span></div>
             <br/>
             <br/>
            {props.loading ? <LoadingOutlined /> : <div style={{height: '60%', overFlowY: 'scroll'}}  dangerouslySetInnerHTML={{__html: props.rawHtmlBody}}></div>}
    </div>
  )
}
